import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Sddiagnostic } from 'src/app/models/Sddiagnostic';

@Injectable({
  providedIn: 'root'
})
export class SddiagnosticService {
  private apiUrl = 'http://your-backend-url/SDiagnostic'; // Update with your actual backend URL

  constructor(private http: HttpClient) {}

  createSddiagnostic(sddiagnostic: Sddiagnostic): Observable<any> {
    return this.http.post(`${this.apiUrl}/createSdiagnostics`, sddiagnostic);
  }
}
